⁣
⭐️Weight ⬇️ 0.6kg this week⁣
⭐️Fasted cardio got increased last week from 25 to 35 minutes, but I do love the stair master so no complaints here, will do whatever is needed! 🙈⁣
⁣
🙌 Ecstatic because this weekend I’ve been instructed to rest, so no workouts, no cardio, and to stay under 8K steps. Food has also been increased, carbs increased to take me out of my deficit 😌❤️. All of this is to reduce my cortisol levels, really try to remove as much stress as possible from my body, and as much as I do love training, I know my body is going to be pretty freaking happy and hopefully I’ll get some more energy back after this weekend 🙌⭐️ ⁣
⁣
I also wanted to talk about bad body image days. Our brains can make us see things in such a skewed way. Even for someone who is incredibly lean, in fact unhealthily lean for the specific goal of competing, bad body image days still exist. I woke up today and felt “fat”. Yup, ridiculous and logic wise, I KNOW I am far from fat.. I took my check in video and wanted to cry because I felt so disappointed with myself and my progress this week. ⁣
⁣
The message I wanted to send across from this is that if you think that getting to a certain body fat % or physique will mean you’ll finally be happy with yourself, you’re wrong. Literally ask any competitor and I BET you they will tell you they have bad body image days, EVEN at their competing physique. Make sure your fitness goals are based on more than just a certain physique, look at your strength gains, your mental gains and how fitness can improve your quality of life in general, you’ll find that much more rewarding ❤️😇 ⁣
⁣
I know this is just my prep brain speaking rubbish so I’m moving on, but I do hope that this can remind you that bad body image days are completely normal no matter who you are ❤️⁣";}i:212;a:1:{s:14:"comments_count";i:38;}i:213;a:1:{s:11:"likes_count";i:137;}i:214;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEug3oXj3D_";}i:215;a:1:{s:5:"image";s:248:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118701731_700510044140373_3513692588126831855_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=109&_nc_ohc=SHd6wPjHGm0AX9OP-v8&_nc_tp=18&oh=1071757b3c1f6e36c9e69b67a6624852&oe=5F7DC487";}i:216;a:1:{s:4:"type";s:5:"image";}i:217;a:1:{s:8:"owner_id";i:8264862631;}i:218;a:1:{s:14:"owner_username";s:0:"";}i:219;a:1:{s:14:"owner_fullname";s:0:"";}i:220;a:1:{s:9:"owner_pic";s:0:"";}i:221;a:1:{s:2:"id";s:19:"2390992871873350423";}i:222;a:1:{s:10:"short_code";s:11:"CEug1lUgIsX";}i:223;a:1:{s:12:"created_time";i:1599248583;}i:224;a:1:{s:7:"caption";s:707:"I can’t believe we are almost at the end of #bbgzeroequipment week 2. So many things are happening in everyone’s life but still all these fierce, strong, determined and motivational women from all over the world will always be there for you, guide, cheer and motivate you. #bbgzerobossbabes each and every single one of you has a pure heart and nothin else but love for every. I felt lazy today , PMSing, but watching all videos and stories on Instagram made me move my a** and just do the workout. Never felt better after. Lots of love, hugs and my appreciation to all of you girls out there on the world, supporting other women. #bbg #bbgcommunity #bbggirls #bbgsisters #sweatsisters #workout #fitgirl";}i:225;a:1:{s:14:"comments_count";i:4;}i:226;a:1:{s:11:"likes_count";i:13;}i:227;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEug1lUgIsX";}i:228;a:1:{s:5:"image";s:259:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118644012_796637891089701_6230216242116591400_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=109&_nc_ohc=hZBuUxZm2WAAX9RgYYq&_nc_tp=15&oh=7bd88e0199f5368b670ca73dd304ddbb&oe=5F7A79CC";}i:229;a:1:{s:4:"type";s:5:"image";}i:230;a:1:{s:8:"owner_id";i:3467830400;}i:231;a:1:{s:14:"owner_username";s:0:"";}i:232;a:1:{s:14:"owner_fullname";s:0:"";}i:233;a:1:{s:9:"owner_pic";s:0:"";}i:234;a:1:{s:2:"id";s:19:"2390992827146239581";}i:235;a:1:{s:10:"short_code";s:11:"CEug07qjv5d";}i:236;a:1:{s:12:"created_time";i:1599248577;}i:237;a:1:{s:7:"caption";s:964:"Starting a new diet? Make sure to ask yourself these questions 🤔

We all know that feeling before starting a diet, you feel excited, ready to commit and determined. 

Then the time comes and the diet is totally miserable 😩 all we can think about is donuts, chips and when this dang diet will be over! 

If this feels like a cycle you continually go through, start asking yourself these questions.

The most important things in a diet are: 
1️⃣Can you stick to it long term? 

2️⃣Does the diet work? (Is there evidence and do you know why it works?)

3️⃣Is it healthy? So many diets out there are too low calorie and have us starving and feeling bad when we give up. When in reality it’s just our body screaming for the proper amount of food. 🤦🏼‍♀️

Make sure you know what you are doing before you just jump in to a new fad diet and that you are taking care of your body 💚

